l.push(new A.hh("Sumantri",4870,"Sumantri adalah gunung tertinggi di Indonesia","Gunung Sumantri, juga dikenal sebagai Puncak Sumantri, adalah salah satu puncak gunung yang berada di Pegunungan Sudirman, Papua, Indonesia. Dengan ketinggian sekitar 4.870 meter (15.978 kaki) di atas permukaan laut, Gunung Sumantri adalah salah satu dari sedikit puncak yang menjulang di wilayah ini dan merupakan bagian dari jajaran gunung-gunung tertinggi di Indonesia.","Papua Tengah, Indonesia","assets/img/sumantri.jpeg","Gunung Sumantri adalah puncak setinggi 4.870 meter di Pegunungan Sudirman, Papua, Indonesia. Terletak di dekat Puncak Jaya, gunung ini berada dalam kawasan terpencil dengan medan yang sangat curam dan tertutup oleh gletser tropis. Topografinya terdiri dari tebing-tebing tinggi dan lembah-lembah dalam, dengan iklim yang ekstrem dan cepat berubah. Gunung ini dikelilingi oleh ekosistem pegunungan yang beragam, mulai dari hutan hujan tropis hingga vegetasi alpine. Akses ke Gunung Sumantri sangat sulit, seringkali memerlukan perjalanan menggunakan helikopter.","Di Gunung Sumantri, yang terletak di Pegunungan Sudirman Papua, iklim sangat dingin dan ekstrem karena ketinggiannya yang mencapai 4.870 meter. Suhu di puncak dapat sangat rendah, sering kali mendekati titik beku, sementara di lereng gunung, iklim cenderung lebih sejuk dengan curah hujan yang tinggi. Gunung ini juga memiliki gletser tropis yang terancam menyusut akibat perubahan iklim. Kondisi cuaca sering kali meliputi kabut tebal, angin kencang, dan hujan deras, yang menambah tantangan bagi pendaki dan mempengaruhi ekosistem di sekitarnya."))
l.push(new A.hh("Merapi",2910,"Merapi adalah Aktif Yang sanga direkomendasiakn di Indonesia","Gunung Merapi adalah salah satu gunung berapi paling aktif di Indonesia dan terkenal di seluruh dunia karena letusannya yang sering dan dahsyat. Terletak di perbatasan antara Provinsi Jawa Tengah dan Daerah Istimewa Yogyakarta, Gunung Merapi memiliki ketinggian sekitar 2.930 meter (9.610 kaki) di atas permukaan laut.","Kabupaten Sleman, DI Yogyakarta","assets/img/merapi.jpeg","Gunung Merapi adalah gunung berapi aktif setinggi 2.930 meter yang terletak di perbatasan Jawa Tengah dan Daerah Istimewa Yogyakarta, Indonesia. Gunung ini merupakan salah satu gunung berapi paling aktif di dunia, dengan letusan yang sering terjadi. Merapi memiliki topografi yang didominasi oleh kawah aktif dan lereng yang curam. Daerah sekitarnya berupa hutan tropis yang subur, namun sering terkena dampak abu vulkanik dan aliran lava saat terjadi letusan. Merapi juga memiliki iklim yang relatif basah, dengan curah hujan tinggi dan suhu yang sejuk di ketinggian.","Di Gunung Merapi, yang terletak di perbatasan Jawa Tengah dan Daerah Istimewa Yogyakarta, iklim di sekitar gunung cenderung sejuk dengan suhu yang bervariasi antara 20 hingga 30 derajat Celsius. Suhu di puncaknya bisa lebih dingin, terutama pada malam hari. Merapi memiliki curah hujan yang tinggi, terutama selama musim hujan, yang sering menyebabkan lerengnya tertutup oleh vegetasi subur. Gunung ini dikenal dengan aktivitas vulkaniknya yang sering, yang dapat menyebabkan perubahan cuaca lokal seperti hujan abu vulkanik dan perubahan suhu mendadak. Selain itu, angin kencang dan kabut juga dapat mempengaruhi kondisi cuaca di sekitar gunung."))
